import React, { useEffect } from "react";
import { connect } from "react-redux";
import { getThumbNails } from "../actions";

const StoreGrid = ({ getThumbNails, thumbNails }) => {
  useEffect(() => {
    getThumbNails();
    // eslint-disable-next-line
  }, []);

  const renderImages = () => {
    return thumbNails.map((photo) => {
      return <img src={photo.image} alt={photo.image} key={photo.id} />;
    });
  };

  return <div className='ui container four'>{renderImages()}</div>;
};

const mapStateToProps = (state) => {
  return {
    thumbNails: state.thumbNails,
  };
};

export default connect(mapStateToProps, {
  getThumbNails,
})(StoreGrid);
